import './App.css';
import Passwords from './components/passwords';
import Popup from 'reactjs-popup';

import { useState} from 'react';


async function getData() {
  const url = "http://127.0.0.1:5000/pythonServer";
  try {
    const response = await fetch(url);
    if (!response.ok) {
      throw new Error(`Response status: ${response.status}`);
    }

    const json = await response.json();
    console.log(json);
  } catch (error) {
    console.error(error.message);
  }
}






function App() {

  let [login, updateLogin] = useState(0);
  const [data, setData] = useState([{}]);
  console.log("Are you loggged in?: " + login)
  return (
    <div>
      {login <= 0 ? 
      (login === -1 ? (
          <div className='App'>
            <Passwords onLogin={(param) => {
              updateLogin(param);
            }}></Passwords>
            <br/>
            <br/>
            <label>Sorry, your login sucks!</label>
          </div>
      ) : (<div className='App'>
            <Passwords onLogin={(param) => {
                updateLogin(param);
              }}></Passwords>
        </div>
        )) 
      :
      <div className='App'>

        <div style={{display: "grid", gridTemplateColumns: "1fr 2fr 1fr"}}>
            <div></div>
            <div><h1>FAKYAK HOMEPAGE</h1></div>
            <div>
              <button onClick={() => updateLogin(0)}>LOG OUT</button>
            </div>

        </div>


        <div>
                <div>
                <label>Post Content: </label>
                </div>
                <div>
                <textarea id="w3review" name="w3review" rows="4" cols="50"></textarea>
                </div>


                <button onClick={() => {
                    console.log("You clicked me!")
                }}>SUBMIT</button>
        </div>
        <br/>
        <br/>
        <br/>
        <br/>
        <div>
        <button onClick={getData}>Get Data</button>
        </div>

        </div>}  
    </div>
  );
}




export default App;
